import{_ as e,o as t,c as a,d as i}from"./app.88375fe2.js";const k=JSON.parse('{"title":"\u{1F527} Pack Types","description":"Find out how bridge. handles pack types","frontmatter":{"title":"\u{1F527} Pack Types","description":"Find out how bridge. handles pack types","sidebar":"misc"},"headers":[{"level":2,"title":"Basics","slug":"basics"},{"level":2,"title":"Useful Information","slug":"useful-information"}],"relativePath":"extensions/misc/pack-types.md","lastUpdated":1665861332000}'),d={name:"extensions/misc/pack-types.md"},s=i('<h1 id="\u{1F527}-pack-types" tabindex="-1">\u{1F527} Pack Types <a class="header-anchor" href="#\u{1F527}-pack-types" aria-hidden="true">#</a></h1><p>It is useful to be aware of how bridge. distinguishes different pack types in a project, when developing an extension.</p><h2 id="basics" tabindex="-1">Basics <a class="header-anchor" href="#basics" aria-hidden="true">#</a></h2><p>Each bridge. project can contain up to four different pack types.</p><ul><li>Behavior Pack</li><li>Resource Pack</li><li>Skin Pack</li><li>World Template</li></ul><h2 id="useful-information" tabindex="-1">Useful Information <a class="header-anchor" href="#useful-information" aria-hidden="true">#</a></h2><p>The following pack types are available within bridge. by default.</p><table><thead><tr><th>Pack Type</th><th>ID</th><th>Default Path</th></tr></thead><tbody><tr><td>Behavior Pack</td><td><code>behaviorPack</code></td><td>BP/</td></tr><tr><td>Resource Pack</td><td><code>resourcePack</code></td><td>RP/</td></tr><tr><td>Skin Pack</td><td><code>skinPack</code></td><td>SP/</td></tr><tr><td>World Template</td><td><code>worldTemplate</code></td><td>WT/</td></tr></tbody></table><p>You may need to reference a valid pack type id from the table above within some of bridge.&#39;s APIs.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Users can change the default path of a pack within the <a href="/guide/misc/project-config">project config</a>.</p></div>',10),c=[s];function o(r,n,l,p,h,f){return t(),a("div",null,c)}const _=e(d,[["render",o]]);export{k as __pageData,_ as default};
